$.pjax.defaults.timeout = 5000;

$(document).on('submit', 'form[data-pjax]', function(event) {
    event.preventDefault();
    $.pjax.submit(event, '.pjax-container', {
        scrollTo: false
    });
});

$(document).pjax('a[data-pjax]', '.pjax-container', {
    scrollTo: false
});

$(document).ready(function () {
    $('.datepicker').datepicker({
        autoclose: true,
        todayHighlight: true
    });
});

$('div.alert').not('.alert-important').delay(3000).fadeOut(350);
$('#flash-overlay-modal').modal();

$(document).ready(function () {
    $('.select2').select2();
});

$(document).ready(function () {
    var sortables = document.querySelectorAll('.sortable-list-group');
    Array.prototype.forEach.call(sortables, function(element, index) { Sortable.create(element); });
});

$(document).ready(function () {
    var document_base_url = document.querySelector('meta[name=app_url]').getAttribute('content');
    document_base_url += document_base_url.endsWith('/') ? '' : '/';

    tinyMCE.baseURL = document.querySelector('meta[name=app_url]').getAttribute('content')+'/bower/tinymce';
    tinymce.init({
        branding: false,
        codemirror: {
            config: { // CodeMirror config object
                mode: 'application/x-httpd-php',
                indentWithTabs: true,
                lineNumbers: true,
                // lineWrapping: false,
            },
            // fullscreen: true, // Default setting is false
            // height: 600, // Default value is 550
            indentOnInit: true, // Whether or not to indent code on init.
            jsFiles: [ // Additional JS files to load
                'mode/clike/clike.js',
                'mode/php/php.js'
            ],
            path: 'CodeMirror', // Path to CodeMirror distribution
            // saveCursorPosition: true, // Insert caret marker
            // width: 800 // Default value is 800
        },
        document_base_url: document_base_url,
        file_browser_callback: function (field_name, url, type, win) {
            var mime_type_like = '';
            if (type == 'image') {
                mime_type_like = 'image/';
            } else if (type == 'media') {
                mime_type_like = 'audio/,video/';
            }

            tinyMCE.activeEditor.windowManager.open({
                file: document.querySelector('meta[name=app_url]').getAttribute('content')+'/backend/media?fancybox_to=tinymce&layout=media_iframe&mime_type_like_in='+mime_type_like,
                height: window.innerHeight - 40,
                title: document.querySelector('meta[name=app_name]').getAttribute('content'),
                width: window.innerWidth - 50,
            }, {
                input: field_name,
                window: win
            });

            return false;
        },
        image_advtab: true,
        // menubar: false,
        // mobile: { theme: 'mobile' },
        plugins: 'advlist charmap code codemirror codesample fullscreen help hr image link lists media pagebreak textcolor visualblocks visualchars wordcount',
        relative_urls: true,
        resize: false,
        selector: 'textarea.tinymce',
        skin_url: document.querySelector('meta[name=app_url]').getAttribute('content')+'/bower/tinymce/skins/lightgray',
        theme_url: document.querySelector('meta[name=app_url]').getAttribute('content')+'/bower/tinymce/themes/modern/theme.min.js',
        toolbar: false,
        // toolbar: [
        //     'formatselect bold italic bullist numlist | alignleft aligncenter alignright alignjustify link pagebreak',
        //     'strikethrough hr forecolor backcolor | removeformat charmap outdent indent | undo redo help codesample | code fullscreen'
        // ]
    });
});

$(document).on('change', 'select.provinces', function () {
    $.ajax({
        url: document.querySelector('meta[name="api.geocodes.regencies.index"]').content,
        headers: {
            'Access-Token': document.querySelector('meta[name=access_token]').content
        },
        data: { parent_id: $(this).val() },
        success: function (response) {
            $('select.regencies option:not(:first)').remove();
            $.each(response.data, function(key, regency) {
                $('select.regencies').append('<option value="'+regency.id+'">'+regency.name+'</option>');
            });

            $('select.regencies_rajaongkir option:not(:first)').remove();
            $.each(response.data, function(key, regency) {
                $('select.regencies_rajaongkir').append('<option value="'+regency.id+'">'+regency.rajaongkir_id+'</option>');
            });
        },
    });
});

$(document).on('click', '.table_row_checkbox', function () {
    var checked = true;
    $('.table_row_checkbox').each(function () {
        var self = $(this);
        if (self.is(':checked')) { self.closest('tr').addClass('info'); }
        else { self.closest('tr').removeClass('info'); checked = false; }
        $('.table_row_checkbox_all').prop('checked', checked);
    });
});

$(document).on('click', '.table_row_checkbox_all', function () {
    var self = $(this);
    if (self.is(':checked')) { self.closest('table').find('tbody tr').addClass('info').find('.table_row_checkbox').prop('checked', true); }
    else { self.closest('table').find('tbody tr').removeClass('info').find('.table_row_checkbox').prop('checked', false); }
});

$(document).on('click', '.template_close', function () { $(this).closest('li').remove(); });
